import React from 'react';
import { FaGithub, FaLinkedin, FaEnvelope } from 'react-icons/fa';

function Contact() {
    return (
        <section id="contact" className="container mt-5">
            <h2 className="contact-heading">Get in Touch</h2>
            <div className="contact-methods">
                <a href="mailto:your.email@example.com" className="contact-link">
                    <FaEnvelope className="contact-icon" />
                    <span className="contact-text">your.email@example.com</span>
                </a>
                <a href="https://www.linkedin.com/in/yourusername" className="contact-link" target="_blank" rel="noopener noreferrer">
                    <FaLinkedin className="contact-icon" />
                    <span className="contact-text">LinkedIn/yourusername</span>
                </a>
                <a href="https://github.com/yourusername" className="contact-link" target="_blank" rel="noopener noreferrer">
                    <FaGithub className="contact-icon" />
                    <span className="contact-text">GitHub/yourusername</span>
                </a>
            </div>
        </section>
    );
}

export default Contact;
